import React, {useEffect, useState} from "react";
function FireBackground() {
    return(
        <svg xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink" viewBox="0 0 1921.32 1080">
            <defs>
                <style>{".cls-1{fill:#fc6400;}.cls-2{fill:#d73502;}.cls-3{fill:#b62203;}.cls-4{fill:#212121;}.cls-5{fill:none;}"}</style>
            </defs>
        </svg>
    )
}

export default FireBackground;
